function run(argv) {
  const url = argv[0];
  const title = argv[1].replaceAll('[', '(').replaceAll(']', ')');
  return `Context: [${title}](${url})`;
}

function run(argv) {
  ObjC.import('stdlib')
  const appName = $.getenv('frontmostApp');
  const addContext = $.getenv('addContext') || '';
  const browserList = $.getenv('browserList').split('\n')
  return browserList.includes(appName) && addContext ? 'true' : 'false' ;
}
